import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <Link to="/">Home</Link>
            <Link to="/">About</Link>
            <Link to="/">Portfolio</Link>
        </nav>
    )
}

export default Nav;
